description:
The Bricks is the second album by rap group, Outsidaz. It was released on May 22, 2001 for Rufflife Records and featuring production by Rockwilder, DJ Twinz, DJ Spunk, Hotrunner, Denaun Porter, Gov Mattic and Self-Service. The Bricks peaked at #68 on the Top R&amp;B/Hip-Hop Albums, #48 on the Top Heatseekers and #29 on the Top Independent Albums.


